import logo from './logo.svg';
import './App.css';
import './css/bootstrap.min.css'
function App() {
  return (
    <div>
      <header className="container">
        <div>
         <img className="w-75 pt-2" src={logo} alt="logo" width="60" height="70"/>
         <p>Hello, </p>
        </div>
      </header>
    </div>
  );
}

export default App;
